import React from 'react';
import './Concept.css';

function Concept() {
  return (
  <>
    <div id="home_part_concept">
       <h2> Le concept d'O <span>and</span>B </h2>
       <div class="container">
          <div class="row"><div class="concept_left">
             <div class="bg"><iframe width="520" height="290" src="https://www.youtube.com/embed/sQng2vE9aWM" frameborder="0" allowfullscreen=""></iframe><h3>OandB</h3><p>OandB est votre outil digital pour organiser des événements professionnels de qualité sans intermédiaires et en toute simplicité</p><p>Un seul support intégré pour gérer l'ensemble des composantes de votre événement : Gagnez du temps, négociez vos tarifs, comparez les prix en toute transparence et bénéficiez de notre séléction de qualité des meilleurs prestataires.</p></div></div><div class="concept_right"><ul class="concept_list"><li><i class="icon_billeterie"></i><div class="item"><h4>Inscription à l'événement / Billetterie</h4><p>Gérez simplement les inscriptions de tous vos participants et utilisez l'application mobile OandB pour contrôler les accès à l'entrée de l'événement</p></div></li><li><i class="icon_paiements"></i><div class="item"><h4>PAIEMENTS SECURISES</h4><p>Réglez vos prestations de manière 100 % sécurisée. Gérez facilement votre facturation depuis votre tableau de bord</p></div></li><li><i class="icon_participants"></i><div class="item"><h4>Gagnez des participants</h4><p>Utilisez les outils de communication à votre disposition pour optimiser le taux de remplissage de votre événement et dialoguez avec vos participants</p></div></li><li><i class="icon_prestataires"></i><div class="item"><h4>RECHERCHEZ VOS PRESTATAIRES</h4><p>Votre lieu de réception, votre menu traiteur, vos boissons, vos animations... Trouvez en un clic des prestataires qualifiés par nos soins à l'image de votre événement</p></div></li><li><i class="icon_prix"></i><div class="item"><h4>TRANSPARENCE DES PRIX</h4><p>Les tarifs de vos prestataires sont indiqués directement en ligne. Bénéficiez des meilleurs prix et négociez en ligne !</p></div></li><li><i class="icon_temps"></i><div class="item"><h4>Gagnez du temps</h4><p>Organisez votre événement de A à Z en moins de 10 minutes</p></div></li></ul></div></div></div></div>
  </>
  );
}

export default Concept;
